import React, { useState } from 'react';
import axios from 'axios';
import AppMain from '..';
import { BrowserRouter as Router} from 'react-router-dom';
import RoutesNav from '../../data/Routes';
import { Container, Form, Input, Button } from './LoginStyle';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('https://projetoinicialusr.onrender.com/v1/auth/login');

      if (response) {
        alert('Login bem-sucedido!');
        <Router>
          <RoutesNav/>
          <AppMain/>
        </Router>
      } else {
        alert('Email ou senha inválida');
      }
    } catch (error) {
      console.error('Erro ao fazer login:', error.response ? error.response.data : error.message);
      alert('Erro ao fazer login: ' + (error.response ? error.response.data : error.message));
    }
  };

  return (
    <Container>
      <Form onSubmit={handleSubmit}>
          <label>
              Email:
              <Input 
                  type="email" 
                  value={email} 
                  onChange={(e) => setEmail(e.target.value)} 
                  required 
              />
          </label>
          <label>
              Senha:
              <Input 
                  type="password" 
                  value={password} 
                  onChange={(e) => setPassword(e.target.value)} 
                  required 
              />
          </label>
          <Button type="submit">Login</Button>
      </Form>
        </Container>
  );
};

export default Login;
